import { Form, Input } from 'antd';
const layout = {
  labelCol: {
    span: 5,
  },
  wrapperCol: {
    span: 16,
  },
};
/* eslint-disable no-template-curly-in-string */

const Test = () => {
  return (
    <Form {...layout} name="nest-messages" >

      <Form.Item name={['user', 'website']} label="Website">
        <Input />
      </Form.Item>


    </Form>
  );
};


export default Test;
